import React from 'react';
import { PieChart, Pie, Tooltip } from "recharts";

const data = [
    {name: "Facebook", value: 232323},
    {name: "Instagram", value: 4342432},
    {name: "twitter", value: 43242},
    {name: "reddit", value: 432444}
]


export default function Home() {

return (
    <div>
    <h1>chart title</h1>
    <PieChart width={400} height={400}>
        <Pie dataKey="value" isAnimationActive={false} data={data} cx={200} cy={200} outerRadius={80} fill="#8884d8" label />
        <Tooltip />
      </PieChart>
    </div>
)


}
